import { makeStyles } from '@material-ui/core/styles';

export default makeStyles(() => ({
  root: {
    maxWidth: 768,
    margin: '0 auto',
  },
  wrapper: {
    paddingTop: '3.2rem',
  },
  listBox: {
    marginBottom: '3.2rem',
  },
}));
